import React from "react";
import "./styles.css";

const PasswordComponent = (setPassword) => {
  const updateValue = (e) => {
    props.onChange(e.target.value);
  };
  return (
    <div>
      <input
        className="Layout"
        type="password"
        placeholder="Enter your password"
        value={props.value}
        onChange={(e) => updateValue(e)}
      />
    </div>
  );
};

export default PasswordComponent;
